script: |
  super -f text -I q3202.spq | sort > q3202.out

inputs:
  - name: q3202.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT - + col0 + + col0 + - col2 + col1 * - ( - col1 ) * - col1 * - + col0 + - col1 IN ( - - 51 * - 81 - + col1 * + 1 );
  - name: tab0

outputs:
  - name: q3202.out
    data: |
      15	81	47
      87	21	10
      97	1	99
